import React from "react";
import Background from "../img/background.jpg";
import NavBar from "./navbar";
import user from "../img/user.png";

class Login extends React.Component {

    render() {
        return (
            <div>
                <img id="background" src={ Background } alt="" />
                <NavBar />
                <div className="register_box" id="small">
                    <form className="register" onSubmit={this.handleSubmit}>
                        <div className="message">
                            <img src={user} width={140} height={140} alt="Login" align="center" style="text-align:center;" />
                            <br></br>
                            <input type="String" name="oppsummering" className="form-control" placeholder="Brukernavn"
                                   required/>
                            <input type="String" name="beskrivelse" className="form-control" placeholder="Passord"/>
                        </div>
                        <br></br>
                        <button type="submit" className="btn btn-primary btn-md btn-block">Logg inn</button>}
                    </form>
                </div>
            </div>
        );
    }
}

export default Login;
